import React, {Component} from 'react';
import logo from '../image/Logo.png';
import '../styles/App.css';

class App extends Component{
  constructor(){
    super();
    this.state = {
      results: {}
    }
  }

  render() {
    return (
      <div className="App">
        {/* Parent Div */}
        <div>
          {/* Header div */}
          <img src = {logo} class = "App-logo"></img>
        </div>
        <div>
          {/* sidebar div */}
        </div>
        <div>
          {/* Map Div */}
        </div>
        <div>
          {/* Service Info div */}
        </div>
        <div>
          {/* Hos Info div */}
        </div>
      </div>
    );
  }

}


export default App;
